    useEffect(
      () =>{
        db.collection('His').onSnapshot(snapshot=>{     
        setSongs(snapshot.docs.map(doc=>({...doc.List.data(),id:doc.id
        })))
        console.log(song);
        }

    )}, [] )
      return(
          <>
          <div className="CarouselTitle">
          <p className="CarouselText"></p>
        <Pagination />
      </div>
      <div className="Carousel">
        {song.map((item) => (
          <CarouselItem item={item} />
        ))}
      </div>
          </>
      )
}
  export default CarouselSongNew;
